import React, { useState, useEffect } from 'react';
import { Image } from 'semantic-ui-react';

const SlidingImageBanner = () => {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000/images')
      .then(response => response.json())
      .then(data => setImages(data.photos.slice(0, 5))); // get the first five photos
  }, []);

  return (
    <div className='sliding-image-banner'>
      {images.map(image => (
        <Image key={image.id} src={image.url} alt={image.caption} />
      ))}
    </div>
  );
};

export default SlidingImageBanner;
